      onReady={props.fetchPlaces}
    >
      <Marker onClick={props.onMarkerClick} name={props.data.name} />
      <InfoWindow onClose={props.onInfoWindowClose}>
        <div>
          <h1>{state.data.name}</h1>
        </div>
      </InfoWindow>
    </Map>
  );
}

